import React from 'react';
import { Button } from 'react-materialize';

function TrgiggerButton(props) {
    return (
        <Button href = '#admin-modal' className = 'modal-trigger' onClick = {props.onClick}>
            Admin login
        </Button>
    )
}

export default TrgiggerButton;
